const initialState = {
  post: {
    mainPosts: [
      {
        id: 1,
        User: { id: 1, nickname: "sirri" },
        content: "첫번째 개시글 #해시태그 #해시태그2",
        image: "dd",
      },
    ],
  },
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
